import React, { Component, Img } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom';
import { Card, Badge, Row, Col,
  Button, Menu, Icon, Layout } from 'antd';
const { Header, Content, Footer, Main } = Layout;
// partials
import Calender from './partials/Calendar';
import DivBar from './partials/DivBar';
// css
import './App.css';
import 'antd/dist/antd.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Layout>
          <Header><DivBar/></Header>
          <Content><Main/></Content>
          <Footer></Footer>
        </Layout>
      </div>
    );
  }
}

export default App;
